import React from "react";
import "./shopList.css";

const ShopList = () => {
  const data = [
    { id: 1, name: "" },
    { id: 2, name: "" },
    { id: 3, name: "" },
    { id: 4, name: "" },
    { id: 5, name: "" },
    { id: 6, name: "" },
    { id: 7, name: "" },
    { id: 8, name: "" },
  ];
  return <div className="shop-list"></div>;
};

export default ShopList;
